import React from 'react';
class Hanna extends React.Component { render() {
    return <p>Hanna geroj?</p>;
  }
}

class Eirik extends React.Component { render() {
    return <p>Njet, Eirik geroj!!!</p>;
  }
}

module.exports = {
    Eirik:Eirik,
    Hanna:Hanna,
};
